import React, { useState } from "react";
import { Container, Table, Button, Form, Card } from "react-bootstrap";

const loanData = [
  { id: 1, bank: "HDFC Bank", interest: 7.5, tenure: 60, maxLoan: 2000000 },
  { id: 2, bank: "SBI Bank", interest: 7.2, tenure: 72, maxLoan: 2500000 },
  { id: 3, bank: "ICICI Bank", interest: 8.0, tenure: 48, maxLoan: 1500000 },
  { id: 4, bank: "Axis Bank", interest: 7.8, tenure: 60, maxLoan: 1800000 },
];

const BankLoans = () => {
  const [selectedLoans, setSelectedLoans] = useState([]);
  const [loanAmount, setLoanAmount] = useState(500000);
  const [emiResults, setEmiResults] = useState({});

  const handleCompare = (loan) => {
    setSelectedLoans((prev) =>
      prev.some((l) => l.id === loan.id)
        ? prev.filter((l) => l.id !== loan.id)
        : [...prev, loan]
    );
  };

  const calculateEMI = (loan) => {
    const r = loan.interest / 1200;
    const n = loan.tenure;
    const emi = (loanAmount * r * Math.pow(1 + r, n)) / (Math.pow(1 + r, n) - 1);
    return emi.toFixed(2);
  };

  return (
    <Container className="mt-5">
      <h2 className="text-center mb-4">🏦 Compare Bank Loans</h2>

      <Card className="p-4 shadow-lg mb-3">
        <Form.Group>
          <Form.Label>Enter Loan Amount (₹)</Form.Label>
          <Form.Control
            type="number"
            value={loanAmount}
            onChange={(e) => setLoanAmount(e.target.value)}
          />
        </Form.Group>
      </Card>

      <Table striped bordered hover responsive className="text-center">
        <thead>
          <tr>
            <th>Bank</th>
            <th>Interest Rate (%)</th>
            <th>Tenure (months)</th>
            <th>Max Loan (₹)</th>
            <th>EMI (₹)</th>
            <th>Compare</th>
          </tr>
        </thead>
        <tbody>
          {loanData.map((loan) => (
            <tr key={loan.id}>
              <td>{loan.bank}</td>
              <td>{loan.interest}%</td>
              <td>{loan.tenure} months</td>
              <td>₹{loan.maxLoan.toLocaleString()}</td>
              <td>₹{calculateEMI(loan)}</td>
              <td>
                <Button
                  variant={selectedLoans.some((l) => l.id === loan.id) ? "danger" : "primary"}
                  onClick={() => handleCompare(loan)}
                >
                  {selectedLoans.some((l) => l.id === loan.id) ? "Remove" : "Compare"}
                </Button>
              </td>
            </tr>
          ))}
        </tbody>
      </Table>

      {selectedLoans.length > 0 && (
        <Card className="mt-4 p-4 shadow-lg">
          <h4 className="text-center mb-3">📊 Comparison</h4>
          <Table striped bordered responsive>
            <thead>
              <tr>
                <th>Bank</th>
                <th>Interest Rate (%)</th>
                <th>Tenure (months)</th>
                <th>EMI (₹)</th>
              </tr>
            </thead>
            <tbody>
              {selectedLoans.map((loan) => (
                <tr key={loan.id}>
                  <td>{loan.bank}</td>
                  <td>{loan.interest}%</td>
                  <td>{loan.tenure} months</td>
                  <td>₹{calculateEMI(loan)}</td>
                </tr>
              ))}
            </tbody>
          </Table>
        </Card>
      )}
    </Container>
  );
};

export default BankLoans;
